import React from 'react';
import VirtualKeyboard from "../components/virtualKeyboard";
import {MDBCard} from "mdbreact";

export default class KeyLearn extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            highlightBgColor: "#FF0000"
        }
    }

    render(){
        return (
            <>
                <MDBCard className="card-body" style={{ width: "auto", marginBottom: "50px" }}>
                    S
                </MDBCard>
                <VirtualKeyboard highlightBgColor={this.state.highlightBgColor}/>
            </>
        );
    }
}
